import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import "../styles/landing.css";

const LandingPage = () => {
  const navigate = useNavigate();
  const [theme, setTheme] = useState("light");

  // Apply theme to body
  useEffect(() => {
    document.body.setAttribute("data-theme", theme);
  }, [theme]);

  const toggleTheme = () => {
    setTheme(theme === "light" ? "dark" : "light");
  };

  return (
    <div className="landing">
      {/* ===== Navbar ===== */}
      <nav className="landing-navbar">
        <h2 className="logo" onClick={() => navigate("/")}>
          PrimeTrade<span>AI</span>
        </h2>

        <div className="nav-right">
          <div className="theme-toggle">
            <input
              type="checkbox"
              id="theme-switch"
              checked={theme === "dark"}
              onChange={toggleTheme}
            />
            <label htmlFor="theme-switch"></label>
          </div>

          <div className="nav-actions">
            <button className="nav-btn" onClick={() => navigate("/register")}>
              Sign Up
            </button>
            <button className="nav-btn login" onClick={() => navigate("/login")}>
              Login
            </button>
          </div>
        </div>
      </nav>

      {/* ===== Hero Section ===== */}
      <div className="hero">
        <div className="hero-content">
          <h1 className="animated-text">
            Welcome to PrimeTrade AI
          </h1>
          <p className="tagline">
            Revolutionizing Smart Trading with Artificial Intelligence
          </p>

          <button className="get-started" onClick={() => navigate("/register")}>
            Get Started →
          </button>
        </div>
      </div>

      <footer className="footer">
        <p>© 2025 PrimeTrade AI — All Rights Reserved</p>
      </footer>
    </div>
  );
};

export default LandingPage;
